import React from "react";

class Form extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      laaneBelop: null,
      nominellRente: null,
      terminGebyr: null,
      utlopsDato: null,
      saldoDato: null,
      datoForsteInnbetaling: null,
    };
  }
  mySubmitHandler = (event) => {
    event.preventDefault()
    alert("You are submitting " + this.state.laaneBelop);
    let companies =
    `{
          "laaneBelop": "{this.state.laaneBelop}",
          "nominellRente": 1000,
          "terminGebyr": "432",
          "utlopsDato": 3.6,
          "saldoDato": 43,
          "datoForsteInnbetaling": 43423,
          "ukjentVerdi": "TERMINBELOP"
    }`
    console.log(JSON.parse(companies))
  };
  myChangeHandler = (event) => {
    let nam = event.target.name;
    let val = event.target.value;
    this.setState({ [nam]: val });
  };
  render() {
    return (
      <form onSubmit={this.mySubmitHandler}>
        <h1>Hello {this.state.datoForsteInnbetaling}</h1>
        <input
          type="number"
          name="laaneBelop"
          onChange={this.myChangeHandler}
        />
        <input
          type="number"
          name="nominellRente"
          onChange={this.myChangeHandler}
        />
        <input
          type="number"
          name="terminGebyr"
          onChange={this.myChangeHandler}
        />
        <input 
            type="date" 
            name="utlopsDato" 
            onChange={this.myChangeHandler} />
        <input 
            type="date" 
            name="saldoDato" 
            onChange={this.myChangeHandler} />
        <input
          type="date"
          name="datoForsteInnbetaling"
          onChange={this.myChangeHandler}
        />
        <input 
            type="submit"
        />
      </form>
    );
  }
}

export default Form;
